def return_binary_or_hexa(numbers):
    a = numbers[73]
    b = numbers[84]
    missing_nums = set(range(a+1, b)) - set(numbers[73:85])
    sum_missing = sum(missing_nums)
    if sum_missing % 2 == 1:
        return bin(sum_missing)[2:]
    else:
        return hex(sum_missing)[2:].upper()
